import React from "react";

import '../Css/Boton-Nav.css';
import logoBarra from '../Img/gato-normal.jpg';

function BotonCambioPag(props){
  return(
    <div className = 'contenedor'>
      <img
        className='imagenBarra'
        src={logoBarra}>
      </img>
      <label
        className='BotonCambioPag'>
        {props.titulo2}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo3}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo4}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo5}
      </label>
      <label
        className='BotonCambioPag'>
        {props.titulo6}
      </label>
    </div>
  );
};

export default BotonCambioPag;
